INSERT INTO `tbl_post` (`post_id`, `category_id`, `post_title`, `post_description`, `menu_id`, `image`, `status`, `dateTime`) VALUES
(9, 0, 'AFFORDABLE CARGO TO NIGERIA', '<p>Cargo to Nijeria</p>\r\n\r\n<hr />\r\n<p>We focus on providing timely and affordable Cargo to Nigeria and freight forwarding services to anywhere in the world. If you are looking for a company that is unique, innovative, passionate and driven to help your business succeed in the International market, we have the expertise to help .</p>\r\n', 9, NULL, 1, NULL),
(10, 0, 'Our Company', '<p>We focus on providing timely and affordable Cargo to Nigeria and freight forwarding services to anywhere in the world. If you are looking for a company that is unique, innovative, passionate and driven to help your business succeed in the International market, we have the expertise to help</p>\r\n', 4, NULL, 1, NULL),
(11, 0, 'Pricing', '<p>Pricing</p>\r\n', 5, NULL, 1, NULL),
(30, 4, 'Forwarding', '<p>We provide professional logistics in cargo service , whether it is freight transportation,&nbsp;<a href=\"https://www.investopedia.com/terms/s/supplychain.asp\">supply chain solutions</a>, warehousing and distribution. Africargo has a well-established and reputed cargo delivery network all over the world using different&nbsp;<a href=\"https://africargo.co.uk/services/\">freight means</a>&nbsp;and&nbsp; infrastructure to facilitate the freighting processes which have become quite evident that we are the best option when it comes to procuring, supplying and delivering the necessary amenities from suppliers and shippers all over the world for your business needs.</p>\r\n\r\n<p>Supply chain management happens to be paramount in any company or shipping industry in present time and that is why you need our expertise in logistics services and&nbsp; International freight shipment at handling your supply chain and logistics in other to ensure efficient movement of your goods and other amenities.&nbsp;</p>\r\n\r\n<p>Our service include giving you advice on shipping and delivery options that best suit your requirements and budget. Be it&nbsp;<a href=\"https://africargo.co.uk/service/air-freight/\">Air Freight</a>,&nbsp;<a href=\"https://africargo.co.uk/service/sea-freight/\">Sea freight</a>,&nbsp;<a href=\"https://africargo.co.uk/service/vehicle-shipping\">Vehicle shipping</a>,&nbsp;<a href=\"https://africargo.co.uk/about-us-door-to-door-cargo/\">Door to Door delivery service</a>, you can always count on us as&nbsp; we offer an end-to-end solution for&nbsp;<a href=\"https://www.hcltech.com/technology-qa/what-is-retail-supply-chain-management\">retailers</a>&nbsp;and create a seamless operation which covers global fulfilment,&nbsp;<a href=\"http://www.ebintl.com/AboutUS/GlobalDeliveryModel\">global delivery management</a>,&nbsp;<a href=\"http://www.fedex.com/ca_english/global-returns/\">global returns solutions</a>, and&nbsp;<a href=\"https://searchcio.techtarget.com/definition/e-commerce\">e-commerce</a>&nbsp;development and design through our in-house designed expertise and innovative business software.&nbsp;This is why you can count on our services as an established leader in the field of freight shipment. The fact that we have established a reputation over the years as a leader in this field of international shipping and freight handling makes it an obvious choice for your&nbsp;<a href=\"https://en.wikipedia.org/wiki/Supply_chain_management\">supply chain management.</a></p>\r\n', 8, 'resource/fronted/assets/images/00.jpg', 1, NULL),
(31, 4, 'Haulage', '<p>Air Freight service at Africargo is prompt and proficient means of delivering you goods to Nigeria, Lagos, Abuja, Port Harcourt and so on. Compared to <a href=\"https://africargo.co.uk/service/sea-freight/\">Sea freight</a>, this means of freight is considered faster way of getting you consignment delivered to your expected destination. Our service is more cost effective compared to the traditional airline excess luggage prices. Our unique <a href=\"https://africargo.co.uk/shipping-calculator-2/\">shipping calculator</a> enables you obtain the break down of your cost in less than a second and when you approve of it, our dedicated and professional team will get in touch with you and importantly, you are kept updated on your shipment progresses from start to finish. Our <a href=\"https://en.wikipedia.org/wiki/Freight_rate\">freight rate</a> is very affordable and incomparable to none in the market. The cost of your consignments is dependant on its weight and volume and as one of the leading air freight companies in the UK. We offer several services to different locations all over the world and we dispatch daily for the most efficient service. Make use of our in house <a href=\"https://africargo.co.uk/shipping-calculator-2/\">shipping calculator</a> and you will be amazed. A try will definitely convince you.</p>\r\n', 8, 'resource/fronted/assets/images/001.jpg', 1, NULL),
(32, 4, 'International Shipping', '<p>Looking for a reliable fast Sea freight service? Look no further than Africargo; your local <a href=\"http://www.farrow.com/article-what-is-freight-forwarding\">freight forwarding</a> company offering an extensive range of cargo services.&nbsp;Our unique <a href=\"https://africargo.co.uk/shipping-calculator-2/\">shipping calculator</a> enables you obtain the break down of your cost in less than a second and when you approve of it, our dedicated and professional team will get in touch with you and importantly, you are kept updated on your shipment progresses from start to finish. Our <a href=\"https://en.wikipedia.org/wiki/Freight_rate\">freight rate</a> is very affordable and incomparable to none in the market. A try will convince you.</p>\r\n\r\n<p>Sea freight is the most economical way of sending large volumes of goods internationally. If your delivery is not particularly time-sensitive, then we would recommend this mode of service as a viable alternative to <a href=\"https://africargo.co.uk/service/air-freight/\">air freight</a> or door-to-door courier services.</p>\r\n\r\n<p>To get the most out of this service :&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Plan ahead:</strong> This mode of freight takes much longer time compared to <a href=\"https://africargo.co.uk/service/air-freight/\">air freight</a>, so it&rsquo;s a good idea to make a <a href=\"https://africargo.co.uk/shipping-calculator-2/\">booking</a> well in advance of your desired delivery date. Our specialist freight team will be able to give you estimated transit times depending on the vessel and routing.</li>\r\n	<li><strong>Think big:</strong> As a rule of thumb, greater volumes almost always mean cheaper delivery prices when shipping goods internationally. This is especially true for this type of freight service.</li>\r\n	<li><strong>Protect your goods in transit:</strong> It&rsquo;s important to package your goods correctly to minimise the risk of damage during transit. However, our professional team also assist in packaging and ensure safe delivery of you consignment. <a href=\"https://africargo.co.uk/contact-us/\">Contact Us</a> for a consultation.</li>\r\n</ul>\r\n', 8, 'resource/fronted/assets/images/003.jpg', 1, NULL),
(33, 4, 'Local Shipping', '<p>Africargo is specialised in providing a reliable and fast Vehicle&nbsp; <a href=\"https://en.wikipedia.org/wiki/Shipping_(fandom)\">Shipping</a> to Nigeria, Lagos, Abuja Port Harcourt etc.&nbsp; from UK . We export vehicles including autos, vans, trucks from the UK to Nigeria. Our unique <a href=\"https://africargo.co.uk/shipping-calculator-2/\">shipping calculator</a> enables you obtain the break down of your cost in less than a second and when you approve of it, our dedicated and professional team will get in touch with you and importantly, you are kept updated on your shipment progresses from start to finish. Our <a href=\"https://en.wikipedia.org/wiki/Freight_rate\">freight rate</a> is very affordable and incomparable to none in the market. A try will convince you. <a href=\"https://africargo.co.uk/contact-us/\">Contact Us</a> now.</p>\r\n', 8, 'resource/fronted/assets/images/004.jpg', 1, NULL),
(34, 6, 'CARGO TO NIGERIA', '<p>We focus on providing timely and affordable Cargo to Nigeria and freight forwarding services to anywhere in the world. If you are looking for a company that is unique, innovative, passionate and driven to help your business succeed in the International market, we have the expertise to help .</p>\r\n', 8, NULL, 1, NULL),
(35, 3, 'Terms of Service ', '<p>Terms of Service for X &ndash;Ray Africargo Limited</p>\r\n\r\n<p>If you require any more information or have any questions about our Terms of Service, please feel free to contact us by email at Anchorafricargo.co.uk/contact.<br />\r\nIntroduction</p>\r\n\r\n<p>These terms and conditions govern your use of this website; by using this website, you accept these terms and conditions in full and without reservation. If you disagree with these terms and conditions or any part of these terms and conditions, you must not use this website.</p>\r\n\r\n<p>You must be at least 18 [eighteen] years of age to use this website. By using this website and by agreeing to these terms and conditions, you warrant and represent that you are at least 18 years of age.<br />\r\nLicense to use website</p>\r\n\r\n<p>Unless otherwise stated, africargo.co.uk and/or its licensors own the intellectual property rights published on this website and materials used on africargo.co.uk. Subject to the license below, all these intellectual property rights are reserved.</p>\r\n\r\n<p>You may view, download for caching purposes only, and print pages, files or other content from the website for your own personal use, subject to the restrictions set out below and elsewhere in these terms and conditions.</p>\r\n\r\n<p>You must not:</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; republish material from this website in neither print nor digital media or documents (including republication on another website);<br />\r\n&nbsp;&nbsp;&nbsp; sell, rent or sub-license material from the website;<br />\r\n&nbsp;&nbsp;&nbsp; show any material from the website in public;<br />\r\n&nbsp;&nbsp;&nbsp; reproduce, duplicate, copy or otherwise exploit material on this website for a commercial purpose;<br />\r\n&nbsp;&nbsp;&nbsp; edit or otherwise modify any material on the website;<br />\r\n&nbsp;&nbsp;&nbsp; redistribute material from this website &ndash; except for content specifically and expressly made a